import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { useSignup } from "../../../contexts/SignupContext";
import "../../signup/signup.css"; // go up one level then into signup folder
import SignupProgress from "../../signup/SignupProgress";
// ...existing code...
import { BsEye, BsEyeSlash } from "react-icons/bs";


function SignUp01() {
  const { data, update, setCurrentStep } = useSignup();
  const navigate = useNavigate();

  // state for phone error display
  const [phoneError, setPhoneError] = useState("");
  // state for toggling password visibility
  const [showPassword, setShowPassword] = useState(false);
  // separate toggle for confirm password
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);

  // handle input changes
  const onChange = (e) => update({ [e.target.name]: e.target.value });

  // handle form submission
  const onSubmit = async (e) => {
    e.preventDefault();

    // basic email + password validation
    if (!data.email || !data.password) {
      alert('Email and password are required');
      return;
    }
    if (data.password.length < 8 || !/[0-9]/.test(data.password) || !/[A-Za-z]/.test(data.password)) {
      alert('Password must be at least 8 characters and include letters and numbers');
      return;
    }
    if (data.password !== data.confirmPassword) {
      alert('Passwords do not match');
      return;
    }

    // proceed to personal info step
    navigate('/signup-02');
  };

  // mark current step for progress bar
  useEffect(() => setCurrentStep(1), [setCurrentStep]);

  return (
    <div className="signup01-container">
      {/* top progress indicator */}
      <SignupProgress currentStep={1} />

      <h1 className="signup01-title">Give Us Your Primary Information</h1>

      <form onSubmit={onSubmit}>
        <div className="signup01-grid">
          <div>
            <label className="signup01-label">Email*</label>
            <input
              className="signup01-input"
              name="email"
              value={data.email}
              onChange={onChange}
              placeholder="example@email.com"
            />
          </div>

          {/* password field with show/hide toggle */}
          <div>
            <label className="signup01-label">Password*</label>

            <div className="input-with-icon">
              <input
                className="signup01-input"
                name="password"
                value={data.password}
                onChange={onChange}
                type={showPassword ? "text" : "password"}
                placeholder="Create a password"
                aria-label="Password"
              />
              <button
                type="button"
                className="eye-toggle-label"
                onClick={() => setShowPassword(!showPassword)}
                aria-label={showPassword ? 'Hide password' : 'Show password'}
                title={showPassword ? 'Hide password' : 'Show password'}
              >
                {showPassword ? <BsEyeSlash /> : <BsEye />}
              </button>
            </div>
          </div>

          <div>
            <label className="signup01-label">Confirm Password*</label>

            <div className="input-with-icon">
              <input
                className="signup01-input"
                name="confirmPassword"
                value={data.confirmPassword || ''}
                onChange={onChange}
                type={showConfirmPassword ? 'text' : 'password'}
                placeholder="Confirm your password"
                aria-label="Confirm password"
              />
              <button
                type="button"
                className="eye-toggle-label"
                onClick={() => setShowConfirmPassword(!showConfirmPassword)}
                aria-label={showConfirmPassword ? 'Hide confirm password' : 'Show confirm password'}
                title={showConfirmPassword ? 'Hide confirm password' : 'Show confirm password'}
              >
                {showConfirmPassword ? <BsEyeSlash /> : <BsEye />}
              </button>
            </div>
          </div>

        </div>

        <div style={{ marginTop: 18 }}>
          <p className="small-note">By clicking <strong>Agree &amp; Join</strong> or Continue, you agree to the LinkedIn User Agreement, Privacy Policy, and Cookie Policy.</p>
          <button className="signup01-continue" type="submit">
            Agree &amp; Join
          </button>

          <div style={{ marginTop: 12, textAlign: 'center' }}>
            <span className="small-note">Already on Work Connect? </span>
            <button type="button" className="secondary-btn" onClick={() => window.location.href = '/login'} style={{ marginLeft: 8 }}>Sign in</button>
          </div>
        </div>
      </form>
    </div>
  );
}

export default SignUp01;
